export const isNullOrEmpty = (value) => {
    if(value === null || value === ""){
        return true;
    }else{
        return false;
    }
}

export const getDateFormat = (date) => {
    if(isNullOrEmpty(date)) return "";
    return date.replace(/(\d{4})(\d{2})(\d{2})/g, '$1-$2-$3');
}
